```function updateTodoList(list) {
  for (var i = 0; i &lt; list.childNodes.length; i++) {
    var complete = isCompleted(list.childNodes[i].textContent);
    var urgent = isUrgent(list.childNodes[i].textContent);
    if (complete) {
      list.childNodes[i].remove();
      i--;
    } else if (urgent) {
      list.childNodes[i].classList.add("important");
    }
  }
}

function isCompleted(task) {
  return "COMPLETED" === task.substring(0, 9);
}

function isUrgent(task) {
  return "URGENT" === task.substring(0, 6);
}


function createList(links) {
  var ul = document.createElement("ul");
  for (var title in links) {
    var li = document.createElement("li");
    var a = document.createElement("a");
    a.setAttribute('href', links[title]);
    a.innerHTML = title;
    li.appendChild(a);
    ul.appendChild(li);
  }
  return ul;
}
